// In App.js, add these imports
import Posts from "./Posts";  // Add this import
import PrivateRoute from "./components/PrivateRoute"; // We'll create this next

// Update your Routes to include Posts
function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/about" element={<About />} />
        <Route path="/browse" element={<BrowseProjects />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/verify-email/:token" element={<VerifyEmail />} />
        <Route path="/verify-email" element={<VerifyInstruction />} />
        <Route path="/posts" element={<Posts />} /> {/* Add this line */}
      </Routes>
    </div>
  );
}
